<p class="body-4"> <br> <!-- <a href="#word" data-w-id="bea80c72-366a-0823-77f1-ebefc13c03b2" class="body-2-link">brand</a> and <a href="#contact" data-w-id="bea80c72-366a-0823-77f1-ebefc13c03b5" class="body-2-link">website</a>. Why? Because you’re very smart. That’s why. The good news is: you came to the right place. I’m awesome at doing those things. True story. --></p></div></div><div style="-webkit-transform:translate3d(0, 60PX, 0) scale3d(1, 1, 1) rotateX(0) rotateY(0) rotateZ(0) skew(0, 4DEG);-moz-transform:translate3d(0, 60PX, 0) scale3d(1, 1, 1) rotateX(0) rotateY(0) rotateZ(0) skew(0, 4DEG);-ms-transform:translate3d(0, 60PX, 0) scale3d(1, 1, 1) rotateX(0) rotateY(0) rotateZ(0) skew(0, 4DEG);transform:translate3d(0, 60PX, 0) scale3d(1, 1, 1) rotateX(0) rotateY(0) rotateZ(0) skew(0, 4DEG);opacity:0" class="face-div"></div></header><section id="word" data-scroll-time="1.3" data-w-id="5140378b-7f96-935c-96d2-7ef2e9a4837e" class="section main">
  <div class="no-div word"><div class="no sm">BOBBY</div></div><div class="container"><div data-w-id="5140378b-7f96-935c-96d2-7ef2e9a48383" style="-webkit-transform:translate3d(0, 110PX, 0) scale3d(1, 1, 1) rotateX(0) rotateY(0) rotateZ(0) skew(0, 7DEG);-moz-transform:translate3d(0, 110PX, 0) scale3d(1, 1, 1) rotateX(0) rotateY(0) rotateZ(0) skew(0, 7DEG);-ms-transform:translate3d(0, 110PX, 0) scale3d(1, 1, 1) rotateX(0) rotateY(0) rotateZ(0) skew(0, 7DEG);transform:translate3d(0, 110PX, 0) scale3d(1, 1, 1) rotateX(0) rotateY(0) rotateZ(0) skew(0, 7DEG);opacity:0" class="header-div"><h2 class="heading-2 full">Scientists Dream About Doing Great Things ;<br></h2><h2 class="heading-2">Scientists Dream About Doing Great Things ;<br>Engineers Do Them<br></h2></div><div class="_50-div"><div class="heading-wrap"><h3 class="heading-3">Purpose<br></h3></div><p class="body-2">Computer science is one of the optimal solution for better living and we are very much delighted & pleasured to be a part of this eminent course.</p></div><div class="_50-div"><div class="heading-wrap"><h3 class="heading-3">Aim<br></h3></div>
<p class="body-2">Tomorrow’s problems can’t be solved by yesterday’s technology.So,Don’t be a line follower,Be a path maker</p></div><div class="_50-div"><div class="heading-wrap"><h3 class="heading-3">Thinking out of the box<br></h3></div><p class="body-2">A way of looking at problems or situations from a fresh perspective that suggests unorthodox solutions. Think differently, unconventionally or from a new perspective. This often refers to novel, creative and smart thinking.<br></p></div><div class="_50-div"><div class="heading-wrap"><h3 class="heading-3">Participation<br></h3></div><p class="body-2">The students of CSE department are no less in show case in knowledge and doing service for our campus. They have contributed their best by creating official websites for administration, conducted and participated in many workshops, projects, technical and cultural events.<br></p></div><div class="_50-div"><div class="heading-wrap"><h3 class="heading-3">Hard work<br></h3></div><p class="body-2">Nothing worth having comes easy. That’s why I welcome the struggle and no matter what I try to accomplish, I always give 100%. Unless I give 80%. But what’s 20% really?</p></div><div class="_50-div"><div class="heading-wrap"><h3 class="heading-3">Support<br></h3></div><p class="body-2">We extends our sincere gratitude to our department for the facilities provided and for the encouragement and motivation in our up and downs.<br></p></div></div></section><section class="section thin"><header id="fact" data-scroll-time="1.3" class="hero-wrap _78"><div data-w-id="f0f6d867-58bc-79b0-99e1-fb991bab8bd0" style="-webkit-transform:translate3d(0, 110PX, 0) scale3d(1, 1, 1) rotateX(0) rotateY(0) rotateZ(0) skew(0, 7DEG);-moz-transform:translate3d(0, 110PX, 0) scale3d(1, 1, 1) rotateX(0) rotateY(0) rotateZ(0) skew(0, 7DEG);-ms-transform:translate3d(0, 110PX, 0) scale3d(1, 1, 1) rotateX(0) rotateY(0) rotateZ(0) skew(0, 7DEG);transform:translate3d(0, 110PX, 0) scale3d(1, 1, 1) rotateX(0) rotateY(0) rotateZ(0) skew(0, 7DEG);opacity:0" class="hero-block"><h3 class="heading-5 front">78% OF MY USERS SAY THIS WEBSITE IS AWESOME</h3><img src="https://uploads-ssl.webflow.com/5cd86d6a1cfc8a5c14ae18d1/5cdf010bb27f2643e845a2cb_True-2.gif" data-w-id="f0f6d867-58bc-79b0-99e1-fb991bab8bd3" alt="" class="hero-gif me"><h3 class="heading-5">78% OF MY USERS SAY THIS WEBSITE IS AWESOME</h3><div class="body-3">The other 22% say this website is <a href="#work" data-w-id="f0f6d867-58bc-79b0-99e1-fb991bab8bd8" class="body-2-link">vey useful</a>.</div></div></header><a href="login" data-w-id="de95df9c-59af-1bd9-4779-c8fa7a6a950b" class="pp-cta-div _6 _7 w-inline-block"><div class="round-cta-txt-wrap"><div class="button-text">LOGIN HERE</div></div><div class="round-div-2 _6"></div></a></section><footer id="contact" class="section footer"><a href="contact" data-w-id="5351dec8-5fe6-d632-dc41-aef5a42173c7" class="footer-link w-inline-block"><div class="menu-txt-2 foot">Contact</div><div class="underline mbm-exclusion"></div></a></footer></section><script src="https://d3e54v103j8qbb.cloudfront.net/js/jquery-3.4.1.min.220afd743d.js" type="text/javascript" integrity="sha256-CSXorXvZcTkaix6Yvo6HppcZGetbYMGWSFlBw8HfCJo=" crossorigin="anonymous"></script><script src="https://uploads-ssl.webflow.com/57e173fc691a682976f5ad5c/js/webflow.d10c62956.js" type="text/javascript"></script><!--[if lte IE 9]><script src="//cdnjs.cloudflare.com/ajax/libs/placeholders/3.0.2/placeholders.min.js"></script><![endif]--><script>
